// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.4.25 <0.9.0;
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/proxy/Clones.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";

import "./LicenseToken.sol";
import "./VerifySignature.sol";
import "./UserMonitoringCenter.sol";
import "./ServiceManager.sol";

contract ManagementCenter is Ownable {
    /******************************
        STATEMENTS
    ******************************/
    using EnumerableSet for EnumerableSet.UintSet;
    /******************************
        CONSTANTS
    ******************************/
    uint256 public constant updateDataCost = 10000;

    /******************************
        EVENTS
    ******************************/
    event ManagerTransactionFeedValueChanged(uint256 value);
    event UsersContractCreated(address contractAddress);
    event BuyTokens(address buyer, uint256 amountOfETH, uint256 amountOfTokens);
    event TokensMinted(address buyer, uint256 amountOfETH);
    event ChangeEtherBalance(uint256 value);
    event NewPrivateLicenseEmitted(uint256 licenseId);
    event PrivateLicenseUpdated(uint256 licenseId);
    event ReadUpdatedData(string data, uint256 updateTime);

    /***********************ChangeEtherBalance*******
        VARIABLES
    ******************************/

    // _users Contract Address set
    mapping(address => address) _usersContractAddresses;

    address immutable userCenterImplementation;

    // ECR 721 Licence
    LicenseToken LicenseTokenInstance;
    // Service Manager
    ServiceManager ServiceManagerInstance;

    /**
     * @notice constructor function
     */
    constructor(
        address LicenseLVCAddress,
        address ServiceManagerAddress
    ) {
        userCenterImplementation = address(new UserMonitoringCenter());
        LicenseTokenInstance = LicenseToken(LicenseLVCAddress);
        ServiceManagerInstance = ServiceManager(ServiceManagerAddress);
    }

    //Modifiers
    modifier onlyRegisteredUsers() {
        require(_usersContractAddresses[_msgSender()] != address(0), "NOTFNDU");
        _;
    }

    // GETTERS

    /**
     * @notice Get the License Token Address
     */
    function getLicenseTokenAddress() public view returns (address) {
        return address(LicenseTokenInstance);
    }

    /**
     * @notice Get Service Manager Address
     */
    function getServiceManagerAddress() public view returns (address) {
        return address(ServiceManagerInstance);
    }

    /**
     * @notice Verify an address
     * @param signature signature
     * @param nonce nonce
     */
    function register(uint256 nonce, bytes memory signature)
        public
        returns (address)
    {
        require(_msgSender() != owner(), "UNAUTH");
        require(_usersContractAddresses[_msgSender()] == address(0), "FND");
        require(
            VerifySignature.verifyRegistration(
                _msgSender(),
                address(this),
                nonce,
                "register",
                signature
            ) == true,
            "ERRSIG"
        );
        address clone = Clones.clone(userCenterImplementation);
        UserMonitoringCenter(clone).initialize(
            address(this),
            owner(),
            _msgSender(),
            address(ServiceManagerInstance),
            address(LicenseTokenInstance)
        );
        _usersContractAddresses[_msgSender()] = clone;
        emit UsersContractCreated(_usersContractAddresses[_msgSender()]);
        return clone;
    }

    /**
     * @notice get User Contract Address
     */
    function getUserContractAddress(address userAddress) public view returns (address) {
        return _usersContractAddresses[userAddress];
    }

    function withdraw() public onlyOwner {
        uint256 ownerBalance = address(this).balance;
        require(ownerBalance > 0, "ERRFUN");
        payable(owner()).transfer(ownerBalance);
        emit ChangeEtherBalance(ownerBalance);
    }

    /// @notice buy License for a list of services
    /// @dev Explain to a developer any extra details
    /// @param numberOfMonths number Of Months for the license
    /// @param serviceIds list of service Ids
    function buyLicence(uint256 numberOfMonths, uint256[] memory serviceIds)
        public
        payable
        onlyRegisteredUsers
    {
        require(numberOfMonths > 0 && serviceIds.length > 0, "ERRIN");
        require(msg.value > 0, "ERRBAL");
        uint256 paymentValue = numberOfMonths *
            ServiceManagerInstance.getAddedServicesPricePerMonth(0, serviceIds);
        require(paymentValue > 0, "ERRIN");
        uint256 permissions = LicenseTools.setIndexesBoolean(
            0,
            true,
            serviceIds
        );
        require(msg.value == paymentValue, "ERRINV");
        uint256 newLicenseId = LicenseTokenInstance.createLicense(
            _msgSender(),
            permissions,
            LicenseType.PRIVATE,
            numberOfMonths
        );
        emit NewPrivateLicenseEmitted(newLicenseId);
    }

    /// @notice buy License for a list of services
    /// @dev Explain to a developer any extra details
    /// @param licenseId license Id
    /// @param numberOfMonths number Of Months for the license
    /// @param serviceIds list of service Ids
    function resetLicence(
        uint256 licenseId,
        uint256 numberOfMonths,
        uint256[] memory serviceIds
    ) public payable onlyRegisteredUsers {
        require(numberOfMonths > 0 && serviceIds.length > 0, "ERRIN");
        require(msg.value > 0, "ERRBAL");
        uint256 paymentValue = numberOfMonths *
            ServiceManagerInstance.getAddedServicesPricePerMonth(0, serviceIds);
        require(paymentValue > 0, "ERRIN");
        uint256 permissions = LicenseTools.setIndexesBoolean(
            0,
            true,
            serviceIds
        );
        require(msg.value == paymentValue, "ERRINV");
        LicenseTokenInstance.resetLicense(
            _msgSender(),
            licenseId,
            permissions,
            LicenseType.PRIVATE,
            numberOfMonths
        );
        emit PrivateLicenseUpdated(licenseId);
    }

    /**
     * @notice update Licence
     * @dev Explain to a developer any extra details
     * @param licenseId number Of Months for the license
     * @param extraNumberOfMonths extra Number Of Months
     * @param extraServiceIds list of service Ids
     */
    function updateLicence(
        uint256 licenseId,
        uint256 extraNumberOfMonths,
        uint256[] memory extraServiceIds
    ) public payable onlyRegisteredUsers {
        require(extraNumberOfMonths > 0 || extraServiceIds.length > 0, "ERRIN");
        LicenseInfo memory license = LicenseTokenInstance.getLicense(licenseId);
        require(
            license.state == LicenseState.INACTIVE ||
                (license.expiresOn > block.timestamp &&
                    license.state == LicenseState.ACTIVE),
            "LICEXP"
        );
        //payment to add the service to the end of the license expired data
        uint256 priceForExtraServices = ServiceManagerInstance
            .getAddedServicesPricePerMonth(
                license.servicesIdsPool,
                extraServiceIds
            );
        uint256 paymentRemainingLicenseTime = (license.state ==
            LicenseState.ACTIVE)
            ? (priceForExtraServices * (license.expiresOn - block.timestamp)) /
                30 days
            : priceForExtraServices * license.numberOfMonths;
        //payment to extend the license with the new services
        uint256 newServicesIdsPool = LicenseTools.setIndexesBoolean(
            license.servicesIdsPool,
            true,
            extraServiceIds
        );
        uint256 paymentValueExtraMonth = ServiceManagerInstance
            .getServicesIdsPoolPricePerMonth(newServicesIdsPool) *
            extraNumberOfMonths;
        uint256 totalPayment = paymentRemainingLicenseTime +
            paymentValueExtraMonth;
            if (totalPayment>0)
            {
                require(
                    msg.value >= totalPayment, "ERRVAL"
                );            
                require(
                    ((msg.value - totalPayment)/msg.value)*100 <=1,
                    "ERRBAL"
                );
            }
        LicenseTokenInstance.updateLicense(
            _msgSender(),
            licenseId,
            newServicesIdsPool,
            extraNumberOfMonths
        );
        emit PrivateLicenseUpdated(licenseId);
    }
}

